import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="container">
      <header className="header">
        <img src="<%=require('./image/logo.svg')%>" alt="логотип Mesto Russia" className="header__logo" />
      </header>
    </div>

  );
}

export default App;
